import { useNavigate } from "react-router-dom";

function Main() {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/");
  };

  return (
    <div className="App">
      <div className="container">
        <h1 className="title">메인 페이지</h1>
        <p>로그인 성공!</p>
        <button className="login-btn" onClick={handleLogout}>
          로그아웃
        </button>
      </div>
    </div>
  );
}

export default Main;
